//import
import A from "../A/A"
import logo from "../images/pack.jpg"
import '../SeqHome/SeqHome.css'
//function
const SeqHome=(props)=>{
    return(
        <section className="sec-comp">
        <div className="content-comp">
            <div className="image-section">
                <img src={logo} alt="Queens Care Center Collage"/>
            </div>
            <div className="text-section">
                <h4>{props.title}</h4>
                <h1>props.des}</h1>
                <p>Are you passionate about making a difference in the lives of animals?  Join  RAFEQ and be part of a movement making a real difference!</p>
                <A title={props.btnTitle}/>
            </div>
        </div>
    </section>
    )
}
//export
export default SeqHome;
